import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
    padding: 0 4em;
    padding-bottom: 3em;

    h2{
        font-size: 4.4em;
        font-family: Ruberoid;
        letter-spacing: .2px;
        line-height: 1em;
        margin: 0;
        padding: 0;
    }
`

function Landing5() {
  return (
    <Container>
        <h2>Blog</h2>
    </Container>
  )
}

export default Landing5
